function Start(sEventName, idActor, nUserParam)
	--Reset Boss
	local tBossGroup = Hydra.ActorsLinkedByActorInGroup(idSelf, "BOSS")
	local vBossTetherPos = Hydra.ActorGetPosition(BOSS_TETHER);
	for i, idBoss in ipairs(tBossGroup) do
		Hydra.ActorEnable(idBoss);
		Hydra.ActorSetAITetherPoint(idBoss, vBossTetherPos);
	end	
	--Manually Start Encounter
	Hydra.BossEncounterManuallyQueueStart(BOSS_LEVEL_AREA);
	
	--Play Boss Music
	Hydra.MusicOverride("Sanctuary_Eastern_Continent", sBossMusic)
end

function Start(sEventName, idActor, nUserParam)
	
	-- Play death bark
	Hydra.ActorPlaySimpleConversation(CONVO_BOSS_DEFEATED, idActor);
	
end

function Start(sEventName, idActor, nUserParam)

	-- Play Boss Bark
	Hydra.ActorPlaySimpleConversation(CONVO_BOSS_PHASE_1_TO_2, idActor);

	-- Wait a bit so current Boss user Event does not trigger the next one
	Hydra.Wait(2);

end

function Start(sEventName, idActor, nUserParam)

	-- Play Boss Bark
	Hydra.ActorPlaySimpleConversation(CONVO_BOSS_PHASE_2_TO_3, idActor);
	
end
